import './app.scss';
import { useForm } from 'react-hook-form';

const App = () => {
  const { register, handleSubmit } = useForm();

  // handeleSubmit validation karega agar validate ho jaayega then onSubmit ko call karega or usme data ko bhej dega or is data ko ham print kara sakte hai ya database me send kar kar sakte hai.

  const onSubmit = (data) => {
    console.log(data);
  };
  return (
    <>
      <div className="App">
        hello
        <div className="container py-3">
          <div className="card border-0 shadow w-75 p-3 mx-auto">
            <form onSubmit={handleSubmit(onSubmit)}>
              <input
                type="text"
                className="form-control"
                id="fullname"
                placeholder="Enter Your Full Name"
                ref={register}
                name="fullName"
              />

              <button className="btn btn-primary" type="submit">
                Create New Account
              </button>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
